import React, { useState } from 'react'
import { count } from '../store/reducers/exampleReducer'
import Header from '../components/Header'
import HeaderContent from '../components/HeaderContent'
import Footer from '../components/Footer'
import { configureStore, createSlice } from '@reduxjs/toolkit'
import { useSelector, useDispatch } from 'react-redux'

const Article3 = () => {
  const userManagamentSlice = createSlice({
    name: "userManagament",
  });

  const store = configureStore({
    reducer: userManagamentSlice.reducer,
  });
  const { images, imagess, count } = useSelector((state) => state.userManagament);
  const dispatch = useDispatch();

  return (
    <div>
      <Header />
      <div className="w-full min-h-[85vh] max-h-[90vh] h-full bg-[#f2f2f2] p-10">
        <div className="m-auto p-16 h-full container bg-stone-200 grid h-full min-h-[75vh] h-fit flex p-4">
          <div className="h-full grid items-center grid-cols-3 p-4 gap-5 overflow-hidden px-10 text-stone-600">
            <div className="card w-full h-full min-h-[350px] max-h-[350px] border border-2 border-[#000]"></div>
            <div className="card w-full h-full min-h-[350px] max-h-[350px] border border-2 border-[#000]"></div>
            <div className="card w-full h-full min-h-[350px] max-h-[350px] border border-2 border-[#000]"></div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  )
}

export default Article3
